import Header from "../components/header";
import Layout from "../components/layout";
import Link from "next/link";

const Communication = () => (
  <div className="comm">
    <ul>
      <li>
        <Link href="https://www.linkedin.com/in/erin%C3%A7-polat-4bb7bb192/">
          <a>LinkedIn</a>
        </Link>
      </li>
      <li>
        <Link href="https://www.instagram.com/erincpolat">
          <a>Instagram</a>
        </Link>
      </li>
      <li>
        <Link href="https://github.com/epolat-github">
          <a>GitHub</a>
        </Link>
      </li>
      <li>
        <Link href="erinc.polat@gmail.com">
          <a>Mail</a>
        </Link>
      </li>
    </ul>
    <style jsx>{`
      .comm ul {
        padding: 0px;
        list-style: none;
      }
    `}</style>
  </div>
);

const Index = () => (
  <Layout>
    <div className="index-container">
      <article>
        <section id="summaryText">
          <img src="/logo.png" alt="picture" />
          <p>Erin√ß Polat = {"{"}</p>
          <p>
            Full-time: "learner", <br />
            Part time: "student" <br />
          </p>
          <p>{"}"};</p>
        </section>
      </article>
      <style jsx>{`
        #summaryText {
          background-color: #001f3f;
          padding: 30% 30%;
        }
        #summaryText p {
          width: 1300px;
          color: white;
          font-size: 38px;
          font-weight: bold;
          text-align: left;
        }
        #summaryText p:nth-child(3) {
          padding-left: 50%;
        }
        #summaryText p:nth-child(4) {
          padding-left: 60%;
        }
      `}</style>
      <Communication />
    </div>
  </Layout>
);

export default Index;
